INSERT INTO `Review` VALUES (1,'Modern downtown location','Apartments have laundry and dishwasher in suite. Big windows- we have a view which is nice. Friendly helpful management. They quickly address any issues and helped me super fast when I lost my key once. The staff cleaner keeps it nice and clean. Secure feeling and there is parking available and a share car service and storage locker.','1cf872c4212353c2d7d96b6de6315f26babfa9978203e7cfb4b75f9125a3e457',4,1,1,'2024-11-24 19:38:53.069','2024-12-03 17:38:36.388'),(2,'Best place I\'ve ever lived','This is the best place I\'ve ever lived. It was my very first time living by myself. They are very good at managing and communicating. The location is very convenient, and everything is close by. They have a gym, TV room, office, table tennis, and other amenities.','4b7e8f61dd260db02cf61d20714c2d8c9d47510096d3720ab6e679d76883587b',5,2,1,'2024-11-24 19:39:34.262','2024-12-01 04:17:47.125'),(3,'Great location and staff','Location cannot be better. The staff is very friendly and welcoming. Sign for a 6 months lease and continue month to month after. Any issue in the apartment is taken care of pretty quickly and they even have after-hours hotline and emergency caretaker onsite.','37cb7c2642ad02f1a57a3b86668fee032302b92c2cc7102b949f2e03e2801bed',4,2,2,'2024-11-24 19:39:42.893','2024-11-24 19:39:42.893'),(4,'Do not live here','Whatever you do. Do not live here. Everything they tell you is a lie. If you like sirens at 4am 2am 12pm 3am 3:45am then this is the place for you. Oh, did I mention the smell of the garbage in the stairwell?','b5b413e52268a64d3055dd97de4a16be8915e6855277f75336e2f8f827561bd0',1,3,3,'2024-11-24 19:39:52.943','2024-11-24 19:39:52.943'),(18,'SO DISGUSTING','SSSSSSSSSSSS','17db0f631ce0d1a678318b6721b30a83f76e6662be1ccd068afde1067e33e0f4',1,4,9,'2024-12-02 22:18:55.499','2024-12-02 22:18:55.499'),(24,'GOOOOOOOOOfffffffffff','errrrrr','618072e68dbe97b6bbf2b62b5830e0c5b88aa41809c5ab3329ffab8847a1c0a3',5,5,1,'2024-12-03 17:55:01.852','2024-12-03 19:06:29.828'),(25,'PETERPANISFLYING','WWWWWW','b1eedd29abf7e8b9b5c67030fc59dd42a4e16a0585c26176de357a4757515ed6',1,9,1,'2024-12-03 18:40:37.461','2024-12-03 18:40:46.841'),(26,'lalalallallasdcsadva','fvdfsvfvafvavavqa','73a7d8280af057822fa7e6c3139363ee3aeca9e39bd6e8e1e3329f4b0c670e20',1,20,13,'2024-12-03 18:42:07.533','2024-12-03 18:42:07.533'),(27,'dddddd','ssssssssssssss','e2aa442c7891b1523fbf2d33991a1b5fec060f73fa20fd88aebfd6b7a3249532',3,18,1,'2024-12-03 19:07:03.195','2024-12-03 19:07:03.195');
